import React,{Component} from 'react';
import {Link} from 'react-router-dom';

export default class NavBar extends Component{
    render() {
        return(
        <nav className="flex flex-wrap w-full justify-center h-16 border-b-2 border-solid border-gray300">
            <div class="flex items-center justify-between">

            <Link to="/" className="text-gray-800 text-sm font-semibold hover:text-purple-600 mr-4">ExcerTracker</Link>

            <Link to="/" className="text-gray-800 text-sm font-semibold hover:text-purple-600 mr-4">Exercises</Link>

            <Link to="/create" className="text-gray-800 text-sm font-semibold hover:text-purple-600 mr-4">Create Exercise Log</Link>
            <Link to="/user" className="text-gray-800 text-sm font-semibold hover:text-purple-600 mr-4">Create User</Link>
            </div>
      </nav>
        );
    }
}
